import React, { Component }  from 'react';
import MainPanel from './MainMenuPanel';
class ContentPage extends Component{

    render() {
        let inlinestyle = {
            backgroundColor:"white"
        };
        return (
          <div className="row">
            <div className="col-xs-12" style={inlinestyle}>test content </div>
            <MainPanel></MainPanel>
            </div>
        );
      }
}

export default ContentPage;
